  \"OrFPGA: An Empirical Performance Tuning Tool for FPGA Designs Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T01:22:44.369104\",\n\t\"name\": \"orfpga-an-empirical-performance-tuning-tool-for-fpga-designs-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this Phase II STTR project, RNET and
  its subcontractors are proposing to fully develop an empirical performance optimization
  tool called OrFPGA that efficiently explores the \"user tunable\" parameter space
  of an FPGA design and assists in deducing the near optimal design in terms of timing
  score, device utilization, and power consumption. The tunable parameter space will
  include IPCore parameters, HDL and HLS code constructs, and parameter settings for
  the vendor's design tools. Special automation tools will be developed to facilitate
  annotation of HDL/HLS code and design tool scripts. The computational magnitude
  of empirical performance tuning of FPGA designs will be addressed by novel machine
  learning based search algorithms requiring minimal empirical evaluations, computational
  steering, leveraging intermediate performance analysis results, and parallelization
  techniques. The tool will support specification of prioritized performance metrics,
  easy-to-use interfaces for defining the parameter space, and intuitive visualization
  of performance models. The user will be able to automatically deduce the best environment
  settings the chip and also accurately identify the optimal power consumption through
  optional real-time power monitoring. The benefits of the tool to NASA will be demonstrated
  in terms of performance metrics and cost benefits (user productivity) using real
  NASA designs that are used in space missions.\",\n\t\"license_title\": \"U.S. Government
